import React from 'react';
import './Footer.css';

const Footer = () => {
    return (
        <>
            <footer className="footer footer-left-section">
                <div className="footer-left">
                    Designed by: Sachin G M | Sharon Melhi | Aditya Banerjee
                </div>
            </footer>
            <footer className="footer footer-right-section">
                <div className="footer-right">
                    Powered by: Amity University Bengaluru
                </div>
            </footer>
        </>
    );
};

export default Footer;
